export const TableChild = ({titre, headers, rows, buttons}) => {
    return (
        <>
            <h5>{titre}</h5>
            <br/>
            <table id="myDataTable" className="table" style={{width: '100%'}}>
                <thead>
                <tr>
                    {headers.map((header, index) => (
                        <th key={index}>{header}</th>
                    ))}
                    <th></th>
                    <th></th>
                </tr>
                </thead>
                <tbody>
                {rows.map((row, i) => (
                    <tr key={i}>
                        {row.map((cell, j) => (
                            <td key={j}>{cell}</td>
                        ))}
                            {

                                buttons.map((button, t) => (
                                    <td key={t}>
                                    <button className={button.className} onClick={button.event(rows[i][0])}>
                                        <i className={button.icon}></i> {button.value}
                                    </button>
                                    </td>
                                ))
                            }
                    </tr>
                ))}
                </tbody>
            </table>
        </>
    )
}
